import React, { Component } from 'react';
import './App.css';
import Intro from './components/Intro'




class App extends Component {

	render() {
		return (
		   <div className="App">
		      <header className="App-header">
		        <h1 className="App-title">Beauty List</h1>
		      </header>
		      <Intro message="Here you will find most favourite Beauty List"/>
			</div>
		)
	}
}
export default App;
